import ExpenseItem from "./ExpenseItem"

export default function ExpenseItems(expensesArr) {
    return (
        <div className="expenses">
            <ExpenseItem title={expensesArr[0].title} amount={expensesArr[0].amount} date={expensesArr[0].date} />
            <ExpenseItem title={expensesArr[1].title} amount={expensesArr[1].amount} date={expensesArr[1].date}/>
            <ExpenseItem title={expensesArr[2].title} amount={expensesArr[2].amount} date={expensesArr[2].date}/>
            <ExpenseItem title={expensesArr[3].title} amount={expensesArr[3].amount} date={expensesArr[3].date}/>
        </div>
    )
}
